// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

contract Campaign {
    address payable public immutable owner;
    uint public immutable goal;
    uint public immutable deadline;
    bool private hasCampaignEnded;

    mapping(address => uint) public contributorsToFunds;
    address[] public contributors;

    // Events to log significant actions in the contract
    event Contributed(address indexed contributor, uint amount);
    event FundsWithdrawn(address indexed owner, uint amount);
    event RefundIssued(address indexed contributor, uint amount);


    // Constructor to initialize the campaign
    constructor(uint _goal, uint _duration) {
        owner = payable(msg.sender);
        goal = _goal;
        deadline = block.timestamp + _duration;
        hasCampaignEnded = false;
    }

    // Function to contribute to the campaign
    function contribute() external payable beforeDeadline campaignNotEnded providingFunds {
        if (contributorsToFunds[msg.sender] == 0) {
            contributors.push(msg.sender);
        }

        contributorsToFunds[msg.sender] += msg.value;

        emit Contributed(msg.sender, msg.value);
    }

    // Function to withdraw funds if the campaign is successful
    function withdrawFunds() external isOwner campaignNotEnded reachedGoal {
        uint balance = address(this).balance;
        (bool fundsWithdrawn,) = owner.call{value: balance}("");
        require(fundsWithdrawn, "Funds withdrawal failed");

        hasCampaignEnded = true;
        emit FundsWithdrawn(owner, balance);
    }

    // Function to get the status of the campaign
    function getStatus() public view returns (string memory) {
        if (block.timestamp < deadline) {
            return "Active";
        } else {
            if (address(this).balance >= goal) {
                return "Completed";
            } else {
                return "Failed";
            }
        }
    }

    // Function to return funds to contributors if the campaign fails
    // This could be called by an oracle in the future for automated refunds
    function returnFunds() public afterDeadline campaignNotEnded {
        require(address(this).balance < goal, "Campaign reached its goal");

        for (uint i = 0; i < contributors.length; i++) {
            address contributor = contributors[i];
            uint amount = contributorsToFunds[contributor];

            if (amount > 0) {
                contributorsToFunds[contributor] = 0;  // Zero out the balance before sending to prevent reentrancy
                (bool refundSuccess,) = contributor.call{value: amount}("");
                require(refundSuccess, "Refund failed");

                emit RefundIssued(contributor, amount);
            }
        }

        hasCampaignEnded = true;
    }

    // Error messages for the custom error handling
    error notOwner();
    error goalNotReached();
    error reachedDeadline();
    error deadlineNotReached();
    error zeroFunds();
    error campaignEnded();

    // Modifier to check if the sender is the campaign owner
    modifier isOwner() {
        if (msg.sender != owner) {
            revert notOwner();
        }
        _;
    }

    // Modifier to ensure the campaign has reached its goal
    modifier reachedGoal() {
        if (address(this).balance < goal) {
            revert goalNotReached();
        }
        _;
    }

    // Modifier to ensure the campaign is still before the deadline
    modifier beforeDeadline() {
        if (block.timestamp > deadline) {
            revert reachedDeadline();
        }
        _;
    }

    // Modifier to ensure the campaign is after the deadline
    modifier afterDeadline() {
        if (block.timestamp < deadline) {
            revert deadlineNotReached();
        }
        _;
    }

    // Modifier to ensure a contribution is greater than 0
    modifier providingFunds() {
        if (msg.value <= 0) {
            revert zeroFunds();
        }
        _;
    }

    // Modifier to check if the campaign has ended
    modifier campaignNotEnded() {
        if (hasCampaignEnded) {
            revert campaignEnded();
        }
        _;
    }
}
